import styled from "styled-components";
import Card from "@mui/material/Card";
import { CardMedia } from "@mui/material";


export const StyledCard = styled(Card)`
    color: red;
    margin: auto;
`;



export const styledCardMedia = styled(CardMedia)`
    width: 100%;
    height: 100%;
`
